export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},N72BhTZp6W:{data:{id:697,attributes:{imdbId:"tt0245844",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMDM0ZWRjZDgtZWI0MS00ZTIzLTg4MWYtZjU5MDEyMDU0ODBjXkEyXkFqcGdeQXVyMTQxNzMzNDI@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.8\u002F10"},{Source:"Rotten Tomatoes",Value:"73%"},{Source:"Metacritic",Value:"61\u002F100"}],item_lang:{data:{id:1360,attributes:{title:g,plot:"'The Count of Monte Cristo' is an adaptation of the Alexander Dumas tale by the same name. Dantes, a sailor who is falsely accused of treason by his best friend Fernand, who wants Dantes' girlfriend Mercedes for himself. Dantes is imprisoned on the island prison of Chateau d'If for 13 years, where he plots revenge against those who betrayed him. With the help of another prisoner, he escapes the island and proceeds to transform himself into the wealthy Count of Monte Cristo as part of his plan to exact revenge.",slug:"the-count-of-monte-cristo"}}},books:{data:[{id:722,attributes:{title:"The Count of Monte-Cristo",description:"The Count of Monte Cristo (French: Le Comte de Monte-Cristo) is an adventure novel by French author Alexandre Dumas completed in 1844. It is one of the author's most popular works, along with The Three Musketeers. Like many of his novels, it is expanded from plot outlines suggested by his collaborating ghostwriter Auguste Maquet.The story takes place in France, Italy, and islands in the Mediterranean during the historical events of 1815-1839: the era of the Bourbon Restoration through the reign of Louis-Philippe of France. It begins just before the Hundred Days period (when Napoleon returned to power after his exile). The historical setting is a fundamental element of the book, an adventure story primarily concerned with themes of hope, justice, vengeance, mercy, and forgiveness. It centres around a man who is wrongfully imprisoned, escapes from jail, acquires a fortune, and sets about getting revenge on those responsible for his imprisonment. However, his plans have devastating consequences for the innocent as well as the guilty. In addition, it is a story that involves romance, loyalty, betrayal, and selfishness, shown throughout the story as characters slowly reveal their true inner nature.The book is considered a literary classic today. According to Luc Sante, \"The Count of Monte Cristo has become a fixture of Western civilization's literature, as inescapable and immediately identifiable as Mickey Mouse, Noah's flood, and the story of Little Red Riding Hood.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RyEEAAAAQAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"1846-01-01",publisher:a,subtitle:a}},{id:723,attributes:{title:"The Originals: The Count of Monte Cristo",description:"On his wedding day, Edmond Dantès, a sailor, is arrested for treason. Charged with being a Bonapartiste, he is wrongfully imprisoned without trial in the dreaded Château d’If. Dantès has been betrayed, concludes his fellow prisoner and mentor, Abbé Faria. After a dramatic escape from prison, Dantès acquires a fortune at the Island of Monte Cristo, and returns to France as the mysterious and sought-after Count of Monte Cristo. With steely resolve, he sets about wreaking vengeance on those who conspired his ruination. And with devastating consequences. Set in France, Italy, and the islands in the Mediterranean during the historical events of 1815–1839, this literary classic by Alexandre Dumas (père), originally published between 1844 and 1845, is an exploration of universal themes like romance, hope, loyalty, betrayal, vengeance, forgiveness and justice.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LVFnDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2018-07-05",publisher:"Om Books International",subtitle:a}},{id:724,attributes:{title:"THE COUNT OF MONTE CRISTO",description:"The Count of Monte Cristo is an adventure novel. It is one of the author's most popular works, along with The Three Musketeers. Dumas completed the work in 1844. The story takes place in France, Italy, islands in the Mediterranean, and in the Levant during the historical events of 1815-1838. It is an adventure story primarily concerned with themes of hope, justice, vengeance, mercy and forgiveness, it focuses on a man who is wrongfully imprisoned, escapes from jail, acquires a fortune and sets about getting revenge on those responsible for his imprisonment. However, his plans have devastating consequences for the innocent as well as the guilty. The book is considered a literary classic today. Alexandre Dumas (1802-1870), was a French writer. His works have been translated into nearly 100 languages, and he is one of the most widely read French authors.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yU5ODwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2017-12-06",publisher:h,subtitle:a}},{id:725,attributes:{title:g,description:"Edmund Dantes, unjustly convicted of aiding the exiled Napoleon, escapes after fourteen years imprisonment and seeks his revenge in Paris",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=nLdLoB7zZ9gC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"1998-01-01",publisher:"Oxford University Press, USA",subtitle:a}},{id:726,attributes:{title:"The Count Of Monte Cristo (Complete)",description:"This carefully crafted ebook: \"The Count Of Monte Cristo (Complete)” is formatted for your eReader with a functional and detailed table of contents. The Count of Monte Cristo (French: Le Comte de Monte-Cristo) is an adventure novel by French author Alexandre Dumas (père). It is one of the author's most popular works, along with The Three Musketeers. Dumas completed the work in 1844. The story takes place in France, Italy, islands in the Mediterranean, and in the Levant during the historical events of 1815–1838. It is an adventure story primarily concerned with themes of hope, justice, vengeance, mercy and forgiveness, it focuses on a man who is wrongfully imprisoned, escapes from jail, acquires a fortune and sets about getting revenge on those responsible for his imprisonment. However, his plans have devastating consequences for the innocent as well as the guilty. The book is considered a literary classic today. According to Luc Sante, \"The Count of Monte Cristo has become a fixture of Western civilization's literature, as inescapable and immediately identifiable as Mickey Mouse, Noah's flood, and the story of Little Red Riding Hood.\" This English translation was originally published in 1846 by Chapman and Hall, London.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dfdBBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2013-01-25",publisher:h,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703520353}}("","Alexandre Dumas","movie",null,"series",1,"The Count of Monte Cristo","e-artnow"))